var resporte_html_especie_fauna = new Vue({
    el: "#resporte_html_especie_fauna",
    data: {
        uri: "http://localhost:3978/api/",
        id_genero: 0,
        especies: [],
        logo: `data:image/png;base64,`
    },
    mounted() {
        this.inicializarEspecies();
    },

    methods: {

        setearEspecies(items) {
            console.log(items)
            this.especies = items;
        },
        inicializarEspecies() {
            let $this = this;
            fetch(this.uri + 'especie_fauna/listsgf')
                .then(res => res.json())
                .catch(error => console.error("Error:", error))
                .then(response => $this.setearEspecies(response.resultado));
        },
        pruebaDivAPdf() {

            var doc = new jsPDF('p', 'pt', 'letter');
            doc.rect(20, 20, 570, 750) //bores de la hoja
            doc.addImage(this.logo, 'JPEG', 270, 30, 70, 70); //logo
            doc.setFontSize(12) //tamao de fuente
            doc.text(180, 110, 'Universidad Nacional Experimental de Guayana.')
            doc.text(140, 125, 'Proyecto: Biocomplejidad en la Cuenca Alta del Ro Botanamo.')
            doc.text(100, 140, 'Listado de Especies de Fauna existentes en la Cuenca Alta del Ro Botanamo.')
            doc.line(100, 141, 520, 141) // subrayado

            doc.rect(40, 170, 530, 580) //borde tabla
            doc.setFillColor(173, 168, 168)
            doc.rect(40, 170, 530, 20, 'FD')
            doc.setFillColor(0, 0, 0)
            doc.line(140, 170, 140, 750) // vertical line sumar +98 en el eje x
            doc.line(240, 170, 240, 750) // vertical line sumar +98 en el eje x
            doc.line(340, 170, 340, 750) // vertical line sumar +98 en el eje x
            doc.line(440, 170, 440, 750) // vertical line sumar +98 en el eje x
            doc.text(70, 185, 'Especie')
            doc.text(145, 185, 'Nombre Comun')
            doc.text(243, 185, 'Nombre Cientifico')
            doc.text(370, 185, 'Genero')
            doc.text(480, 185, 'Familia')
            doc.setFontSize(10) //tamao de fuente
            for (let i = 0, y = 210, y_text = 205; i < 27; i++) {
                if (i < this.especies.length) {
                    doc.text(45, y_text, this.especies[i].nombre_especie);
                    doc.text(145, y_text, this.especies[i].nombre_comun);
                    doc.text(245, y_text, this.especies[i].nombre_cientifico);
                    doc.text(345, y_text, this.especies[i].nombre_cientifico);
                    doc.text(445, y_text, this.especies[i].Genero.Familium.nombre);
                    y_text += 20;
                }
                doc.line(40, y, 570, y) // vertical line sumar 10 en el eje Y
                y = y + 20;
            }
            doc.save('Prueba.pdf');
        }
    },
    filters: {}
});